import AnalysisBoard from '"./components/AnalysisBoard"';


function Category() {
    return (
        <div>
            <h1>Danh sách người dùng</h1>
            <AnalysisBoard endpoint="users" />

            <h1>Danh sách sản phẩm</h1>
            <AnalysisBoard endpoint="products" />
        </div>
    );
}
export default Category;
